import React,{ Component } from 'react'
import './css/ElysianTopBar.css'

class ElysianTopBar extends Component{
    render(){
        return(
            <div className="ElysianTopBar">
                TopPanel
            </div>
        )
    }
}

export default ElysianTopBar
